import React from "react";

const Navbar = () => {
  return (
    <nav style={{ backgroundColor: '#333', color: '#fff', padding: '10px' }}>
    <div style={{ fontSize: '24px', fontWeight: 'bold' }}>E-Website</div>
    <ul style={{ display: 'flex', listStyle: 'none', justifyContent: 'flex-end', alignItems: 'center' }}>
      <li style={{ margin: '0 10px' }}><a style={{ color: '#fff', textDecoration: 'none' }} href="/">Home</a></li>
      <li style={{ margin: '0 10px' }}><a style={{ color: '#fff', textDecoration: 'none' }} href="/login">Login</a></li>
      <li style={{ margin: '0 10px' }}><a style={{ color: '#fff', textDecoration: 'none' }} href="/register">Register</a></li>
    </ul>
  </nav>
  );
};

export default Navbar;
